import React from 'react';
import './Results.css';

const ResultsPage = ({ summary }) => {
    return (
      <div className="page-content">
          <div className=".results-content">
              <h1>Results</h1>
              <p className="summary-text">{summary}</p>
          </div>
      </div>
    );
};

export default ResultsPage;
